<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Flavors Laboratory</title>
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=Anonymous+Pro:wght@400;700&display=swap" rel="stylesheet">
  <style>
    body {
      margin: 0;
      padding: 0;
      width: 100vw;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
      overflow: hidden;
      background-color: #000080;
      transition: background-color 2.5s cubic-bezier(0.4, 0, 0.2, 1);
      font-family: 'Anonymous Pro', monospace;
    }

    .logo-container {
      position: absolute;
      display: flex;
      justify-content: center;
      align-items: center;
    }

    #logo1-container {
      width: 40vmin;
      height: 40vmin;
      opacity: 1;
      cursor: pointer;
      z-index: 2;
      transition: all 2.5s cubic-bezier(0.4, 0, 0.2, 1);
    }

    #logo2-container {
      width: 31.768709461621242vmin;
      height: 31.768709461621242vmin;
      opacity: 0;
      z-index: 1;
      pointer-events: none;
      transition: all 2.5s cubic-bezier(0.4, 0, 0.2, 1);
    }

    #logo-dot-container,
    #tora-dot-container,
    #southeast-dot-container,
    #silk-dot-container {
      width: 31.768709461621242vmin;
      height: 31.768709461621242vmin;
      opacity: 0;
      z-index: 3;
      pointer-events: none;
      transition: all 2.5s cubic-bezier(0.4, 0, 0.2, 1);
    }

    .logo-wrapper { width: 100%; height: 100%; mix-blend-mode: screen; }
    .logo-inner { width: 100%; height: 100%; filter: invert(100%); }

    /* Side text must NOT inherit invert() */
    .no-invert { filter: none !important; mix-blend-mode: normal !important; }

    svg { width: 100%; height: 100%; display: block; }
    #logo2-container svg path, #logo2-container svg use { opacity: 0.3; }

    #initiate-text {
      position: absolute;
      left: 50%;
      transform: translateX(-50%);
      top: calc(50% + 20.0vmin + 30px);
      color: white;
      font-size: 13px;
      font-weight: 700;
      letter-spacing: 0.05em;
      opacity: 1;
      z-index: 5;
      pointer-events: none;
      transition: opacity 0.5s ease;
    }

    .dots::after { content: ''; animation: dots-loop 2s steps(1, end) infinite; }
    @keyframes dots-loop { 0% { content: ''; } 25% { content: '.'; } 50% { content: '..'; } 75% { content: '...'; } }

    .center-text {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      font-size: 3.5vmin;
      font-weight: 700;
      opacity: 0;
      z-index: 999;
      pointer-events: none;
      letter-spacing: 0.1em;
      text-align: center;
      width: 100%;
      transition: opacity 0.3s ease-in-out;
    }

    #proton-text { color: #FF5500; }
    #tora-text { color: #0044CC; }
    #southeast-text { color: #009688; }
    #silk-text { color: #DA70D6; }

    .corner-link {
      position: absolute;
      width: 5vmin;
      height: 5vmin;
      opacity: 0;
      z-index: 20;
      cursor: pointer;
      transition: opacity 0.35s ease;
      pointer-events: none;
    }

    .corner-link svg { width: 100%; height: 100%; fill: white !important; }
    .corner-link svg path, .corner-link svg polygon, .corner-link svg rect { fill: white !important; }

    #link-ig { bottom: 5vmin; left: 5vmin; }
    #link-mail { top: 5vmin; right: 5vmin; }
    #link-smiley { bottom: 5vmin; right: 5vmin; }

    /* SIDE TEXT */
    #universe-text-container {
      position: absolute;
      top: 50%;
      left: 5vmin;
      width: 34vmin;
      transform: translateY(-50%);
      opacity: 0;
      z-index: 60;
      pointer-events: none;
      transition: opacity 0.35s ease;
    }

    #universe-text-container svg {
      width: 100% !important;
      height: auto !important;
      overflow: visible !important;
      display: block;
    }

    #universe-text-container text,
    #universe-text-container tspan,
    #universe-text-container textPath {
      fill: #ffffff !important;
      stroke: none !important;
    }

    /* Inkscape translation in the SVG puts the text off-canvas; neutralize it */
    #universe-text-container g { transform: none !important; }

    body.second-page { background-color: #000015; }
    body.second-page #initiate-text { opacity: 0; }

    body.second-page #logo1-container {
      width: 113.31905075807515vmin;
      height: 113.31905075807515vmin;
      opacity: 0;
      pointer-events: none;
    }

    body.second-page #logo2-container {
      width: 90vmin;
      height: 90vmin;
      opacity: 1;
      pointer-events: auto;
    }

    body.second-page #logo-dot-container,
    body.second-page #tora-dot-container,
    body.second-page #southeast-dot-container,
    body.second-page #silk-dot-container {
      width: 90vmin;
      height: 90vmin;
      opacity: 1;
      pointer-events: none;
    }

    body.second-page .corner-link,
    body.second-page #universe-text-container {
      opacity: 1;
      pointer-events: auto;
      transition-delay: 2.5s;
    }

    .dot-layer svg path,
    .dot-layer svg use {
      pointer-events: none;
      transform-origin: center;
      transform-box: fill-box;
      transition: fill 0.3s ease, transform 0.3s ease;
    }

    body.second-page .dot-layer svg path,
    body.second-page .dot-layer svg use {
      animation: enable-pointer 0s 2.5s forwards;
    }

    @keyframes enable-pointer { to { pointer-events: auto; } }

    body.second-page #logo-dot-container svg path:hover,
    body.second-page #logo-dot-container svg use:hover {
      fill: #00AAFF !important;
      transform: scale(1.4);
      cursor: pointer;
    }

    body.second-page #tora-dot-container svg path:hover,
    body.second-page #tora-dot-container svg use:hover {
      fill: #FFBB33 !important;
      transform: scale(1.4);
      cursor: pointer;
    }

    body.second-page #southeast-dot-container svg path:hover,
    body.second-page #southeast-dot-container svg use:hover {
      fill: #FF6977 !important;
      transform: scale(1.4);
      cursor: pointer;
    }

    body.second-page #silk-dot-container svg path:hover,
    body.second-page #silk-dot-container svg use:hover {
      fill: #258F29 !important;
      transform: scale(1.4);
      cursor: pointer;
    }

    .text-visible { opacity: 1 !important; }
  
/* UNIVERSE TEXT */
#universe-text-container {
    position: absolute;
    left: 50%; top: 50%;
    transform: translate(-50%, -50%);
    width: 145vmin; height: 145vmin;
    opacity: 0;
    z-index: 20;
    pointer-events: none;
    transition: opacity 0.35s ease;
}
body.second-page #universe-text-container { opacity: 1; transition-delay: 2.5s; }

/* QUESTION ICON */
#link-question { 
    top: 5vmin; left: 5vmin; 
    z-index: 500; /* High enough to be clickable */
    pointer-events: auto;
    position: absolute;
}
body.second-page #link-question { opacity: 1; pointer-events: auto; }

/* MODAL */
#newsletter-modal {
    position: fixed; inset: 0; display: none;
    align-items: center; justify-content: center;
    background: rgba(0,0,0,0.0); z-index: 10000;
}
#newsletter-modal.active { display: flex; }
#newsletter-modal .modal-content {
    width: min(70vmin, 760px);
    background: #ffffff; padding: 18px;
    font-family: "Anonymous Pro", monospace;
    position: relative;
}
#newsletter-modal .close-btn { position: absolute; right: 10px; top: 8px; cursor: pointer; color: #000015; font-weight: bold; }
#newsletter-modal .modal-text { margin-bottom: 14px; color: #000015; font-weight: bold; font-size: 13px; }
#newsletter-modal .input-wrapper { background: #000015; height: 64px; display: flex; align-items: center; padding: 0 14px; }
#newsletter-modal #email-input { flex: 1; background: transparent; border: none; color: white; border-bottom: 1px solid rgba(255,255,255,0.3); font-family: inherit; }
#newsletter-modal #enter-btn { width: 40px; height: 40px; background: transparent; border: none; color: white; cursor: pointer; }


    /* --- MOBILE & TABLET OVERRIDES (Re-applied) --- */
    body, html { margin: 0; padding: 0; width: 100%; height: 100%; overflow: hidden; position: fixed; }
    .logo-container, #logo1-container, #logo2-container, #logo-dot-container, #tora-dot-container, #southeast-dot-container, #silk-dot-container {
        position: absolute !important; top: 50% !important; left: 50% !important; transform: translate(-50%, -50%) !important; margin: 0 !important; display: flex; justify-content: center; align-items: center;
    }
    @media (max-width: 768px), (max-height: 500px) {
        #universe-text-container { display: none !important; opacity: 0 !important; pointer-events: none !important; }
        #newsletter-modal .modal-content { width: 90%; max-height: 80vh; overflow-y: auto; }
    }
    @media screen and (max-width: 768px) and (orientation: portrait) {
        #logo1-container { width: 75vw !important; height: 75vw !important; }
        body.second-page #logo2-container { width: 90vw !important; height: 90vw !important; }
        body.second-page #logo-dot-container, body.second-page #tora-dot-container, body.second-page #southeast-dot-container, body.second-page #silk-dot-container { width: 90vw !important; height: 90vw !important; }
        #initiate-text { top: auto !important; bottom: 15vh !important; left: 50% !important; transform: translateX(-50%) !important; width: 100%; text-align: center; font-size: 14px; }
    }
    @media screen and (max-height: 500px) and (orientation: landscape) {
        #logo1-container { width: 50vh !important; height: 50vh !important; }
        body.second-page #logo2-container { width: 80vh !important; height: 80vh !important; }
        body.second-page #logo-dot-container, body.second-page #tora-dot-container, body.second-page #southeast-dot-container, body.second-page #silk-dot-container { width: 80vh !important; height: 80vh !important; }
        #initiate-text { top: 50% !important; left: 50% !important; transform: translate(-50%, 140px) !important; font-size: 12px; }
        .corner-link { width: 30px; height: 30px; margin: 10px; }
        #link-ig { bottom: 10px; left: 10px; }
        #link-mail { top: 10px; right: 10px; }
    }
    body.second-page #initiate-text { opacity: 0 !important; pointer-events: none; }
    body.second-page #logo1-container { opacity: 0 !important; pointer-events: none; }
    @media (max-width: 768px) {
        .center-text { font-size: 18px !important; width: 80% !important; line-height: 1.4; top: 50% !important; left: 50% !important; transform: translate(-50%, -50%) !important; z-index: 2000; padding: 15px; background: rgba(0,0,21,0.85); border-radius: 8px; backdrop-filter: blur(4px); }
    }
    


    /* --- MOBILE CENTER LINK ZONE (v15) --- */
    @media (max-width: 1024px) {
      /* Center tap target is OFF unless link is armed AND dots are usable */
      #mobile-center-tap {
        position: fixed;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        width: min(70vmin, 360px);
        height: min(70vmin, 360px);
        border-radius: 9999px;
        z-index: 99997;
        pointer-events: none;
        background: rgba(0,0,0,0);
      }
      body.second-page.dots-armed.mobile-link-armed #mobile-center-tap {
        pointer-events: auto;
      }

      /* Labels remain visual only */
      .center-text { pointer-events: none !important; }

      /* Optional hint */
      body.second-page.dots-armed.mobile-link-armed::after {
        content: 'Tap center to open';
        position: fixed;
        left: 50%;
        top: calc(50% + 160px);
        transform: translate(-50%, -50%);
        color: rgba(255,255,255,0.75);
        font-size: 12px;
        letter-spacing: 0.08em;
        z-index: 99998;
        pointer-events: none;
      }
    }



    /* --- MOBILE FORCE CENTER CLICK (v18) --- */
    @media (max-width: 1024px) {
      body.mobile-link-armed #logo-dot-container svg path,
      body.mobile-link-armed #logo-dot-container svg use,
      body.mobile-link-armed #tora-dot-container svg path,
      body.mobile-link-armed #tora-dot-container svg use,
      body.mobile-link-armed #southeast-dot-container svg path,
      body.mobile-link-armed #southeast-dot-container svg use,
      body.mobile-link-armed #silk-dot-container svg path,
      body.mobile-link-armed #silk-dot-container svg use {
        pointer-events: none !important;
      }
      .center-text { pointer-events: none !important; }
    }

</style>
</head>

  <script>
document.addEventListener('DOMContentLoaded', () => {
  const modal = document.getElementById('newsletter-modal');
  const openBtn = document.getElementById('link-question');
  const closeBtn = document.getElementById('newsletter-close');
  const enterBtn = document.getElementById('enter-btn');
  const input = document.getElementById('email-input');
  if(openBtn) { openBtn.addEventListener('click', (e) => { e.preventDefault(); e.stopPropagation(); if(modal) { modal.classList.add('active'); if(input) setTimeout(() => input.focus(), 50); } }); }
  function closeModal() { if(modal) modal.classList.remove('active'); }
  if(closeBtn) closeBtn.addEventListener('click', closeModal);
  if(enterBtn) enterBtn.addEventListener('click', closeModal);
  if(modal) modal.addEventListener('click', (e) => { if(e.target === modal) closeModal(); });
  var logo1 = document.getElementById('logo1-container');
  logo1.addEventListener('click', function() { document.body.classList.add('second-page'); if (!document.body.classList.contains('dots-armed')) { window.setTimeout(function() { document.body.classList.add('dots-armed'); }, 2500); } });
  let activeDotId = null;
  function isMobile() { return window.matchMedia("(max-width: 768px)").matches || 'ontouchstart' in window; }
  function handleInteraction(containerId, textId, url) {
    const container = document.getElementById(containerId);
    if (!container) return;
    container.addEventListener('mouseover', function(e) { if (isMobile()) return; if (!document.body.classList.contains('second-page')) return; if (e.target.closest('path') || e.target.closest('use')) { document.getElementById(textId).classList.add('text-visible'); } });
    container.addEventListener('mouseout', function(e) { if (isMobile()) return; if (e.target.closest('path') || e.target.closest('use')) { document.getElementById(textId).classList.remove('text-visible'); } });
    container.addEventListener('click', function(e) { if (!document.body.classList.contains('second-page')) return; if (!document.body.classList.contains('dots-armed')) return; if (e.target.closest('path') || e.target.closest('use')) { if (isMobile()) { e.preventDefault(); e.stopPropagation(); if (activeDotId === containerId) { window.open(url, '_blank'); } else { document.querySelectorAll('.center-text').forEach(el => el.classList.remove('text-visible')); document.getElementById(textId).classList.add('text-visible'); activeDotId = containerId; } } else { window.open(url, '_blank'); } } });
  }
  document.body.addEventListener('click', function(e) { if (isMobile() && activeDotId && !e.target.closest('svg')) { document.querySelectorAll('.center-text').forEach(el => el.classList.remove('text-visible')); activeDotId = null; } });
  handleInteraction('logo-dot-container', 'proton-text', "https://www.instagram.com/p/Cy-6hRboWZE/");
  handleInteraction('tora-dot-container', 'tora-text', "https://www.instagram.com/p/DKxK4DZogFI/?img_index=1");
  handleInteraction('southeast-dot-container', 'southeast-text', "https://www.instagram.com/p/DP8smZBCKqp/");
  handleInteraction('silk-dot-container', 'silk-text', "https://www.instagram.com/p/DFkZWA_om_t/");
});
</script>
